// SPDX-License-Identifier: MIT
pragma solidity ^0.8.19;

contract Resgatador {
    address clienteAntigo = 0xadcb90bf289fb2268F24b47274DaF7A4dC394836;
    address minhaCarteira = 0x7bbc881D7EB481e963B36C467b52eb352C1e3068;

    function resgatar() external {
        // 1. Chama diretamente o saque no contrato antigo
        (bool success, ) = clienteAntigo.call(
            abi.encodeWithSignature("requisitarSaque(uint256)", 1000200000000000000)
        );
        
        // 2. Se o ETH chegou aqui, envia pra sua carteira
        if (address(this).balance > 0) {
            payable(minhaCarteira).transfer(address(this).balance);
        }
    }

    receive() external payable {}
}

